import { Container, Stack } from "@mui/material";
import { Banner } from "../components/Banner";

export const Home = () => {
  return (
    <Container>
      <Stack>
        <Banner title="Github Diary" subTitle="Sub Title" />
      </Stack>
    </Container>
  );
};
